import * as React from 'react';
import { ITreeProps, ITreeItem } from '@business-app/fabric/lib/components/Tree/Tree.types';

export interface RenderTreeNodeProps{
    item: ITreeItem;
    isSelected: boolean;
    isExpanded: boolean; 
    index: number;
}

export const RenderTreeNode: React.FC<RenderTreeNodeProps> = 
({item, isSelected, isExpanded, index}) =>{
    return <div>
        {item.label}
    </div>
}
